import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import userDataService from '../services/userDataService';
import './Pages.css';

const TrackOrders = () => {
  const [activeOrders, setActiveOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const loadUserOrders = async () => {
      try {
        setLoading(true);
        const userOrders = await userDataService.getOrders();
        // Filter for active orders (status = 'pending' or 'in_transit')
        // For now, show recent orders as "active" for demo purposes
        const active = userOrders
          .filter(order => order.status === 'pending' || order.status === 'in_transit')
          .slice(0, 3); // Show only the 3 most recent orders as "active"

        // If no pending orders, show the most recent order as "in transit" for demo
        if (active.length === 0 && userOrders.length > 0) {
          const mostRecent = userOrders[0];
          active.push({
            ...mostRecent,
            status: 'in_transit',
            estimatedDelivery: '30 minutes',
            driver: 'John D.',
            location: 'On the way to your location'
          });
        }
        setActiveOrders(active);
      } catch (err) {
        console.error('Error loading orders:', err);
        setError('Failed to load orders');
      } finally {
        setLoading(false);
      }
    };

    loadUserOrders();
  }, []);

  return (
    <div className="page-container">
      <div className="page-header">
        <Link to="/" className="back-button">
          ‚Üê Back to Home
        </Link>
        <h1>Track Orders</h1>
      </div>

      <div className="page-content">
        {loading ? (
          <div className="loading-state">
            <div className="loading-spinner"></div>
            <p>Loading your active orders...</p>
          </div>
        ) : error ? (
          <div className="error-state">
            <div className="error-icon">‚ö†Ô∏è</div>
            <h3>Error Loading Orders</h3>
            <p>{error}</p>
            <button onClick={() => window.location.reload()} className="retry-button">
              Try Again
            </button>
          </div>
        ) : activeOrders.length > 0 ? (
          <div className="orders-list">
            {activeOrders.map((order) => (
              <div key={order.id} className="order-card">
                <div className="order-header">
                  <h3>{order.dish_name}</h3>
                  <span className={`status-badge ${order.status.toLowerCase().replace(' ', '-')}`}>
                    {order.status}
                  </span>
                </div>

                <div className="order-details">
                  <p><strong>Order ID:</strong> {order.id}</p>
                  <p><strong>Date:</strong> {new Date(order.timestamp).toLocaleDateString()}</p>
                  <p><strong>Servings:</strong> {order.servings}</p>
                  <p><strong>Status:</strong> {order.status}</p>
                  {order.estimatedDelivery && (
                    <p><strong>Estimated Delivery:</strong> {order.estimatedDelivery}</p>
                  )}
                  {order.driver && (
                    <p><strong>Driver:</strong> {order.driver}</p>
                  )}
                  {order.location && (
                    <p><strong>Location:</strong> {order.location}</p>
                  )}
                </div>

                <div className="order-actions">
                  <button className="action-button">Track on Map</button>
                  <button className="action-button secondary">Contact Driver</button>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="empty-state">
            <div className="empty-icon">üöö</div>
            <h3>No Active Orders</h3>
            <p>Your current deliveries will appear here</p>
            <Link to="/" className="cta-button">
              Order Something
            </Link>
          </div>
        )}
      </div>
    </div>
  );
};

export default TrackOrders;
